import React,{Fragment} from 'react'

const CartModalProduct = () => {
  return (
    <Fragment>
        <tr>
            <td><img src={process.env.PUBLIC_URL+"images/slide-1.jpg"} height={50} width={100}/></td>
            <td>Product Name</td>
            <td>Product Price</td>
        </tr>
    </Fragment>
  )
}

export default CartModalProduct
